import '../styles/global.css';
import { createStore } from 'redux';
import { Provider } from 'react-redux';
import allReducers from '../components/reducers/allReducers';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faHome, faShareAlt, faStar, faChartPie, faUserAlt, faSitemap, faCheck, faGripVertical } from '@fortawesome/free-solid-svg-icons';

const icons = [ faHome, faShareAlt, faStar, faChartPie, faUserAlt, faSitemap,faCheck,faGripVertical ];
library.add(fab, ...icons);

const App = ({ Component, pageProps }) => {
	const store = createStore(allReducers);

	return (
		<Provider store={store}>
			<Component {...pageProps} />
		</Provider>
	);
};

export default App;
